defs.value:
pub enum Expr {
    Binary {
        left: Box<Expr>,
        operator: Token,
        right: Box<Expr>,
    },
    Grouping {
        expression: Box<Expr>,
    },
    Literal {
        value: Literal,
    },
    Unary {
        operator: Token,
        right: Box<Expr>,
    },
    Variable {
        name: Token,
    },
    Assign {
        name: Token,
        value: Box<Expr>,
    },
    Logical {
        left: Box<Expr>,
        operator: Token,
        right: Box<Expr>,
    },
    Call {
        callee: Box<Expr>,
        paren: Token,
        arguments: Vec<Expr>,
    },
    Null,
}

defs.docs:
Full grammar
* program         declaration* EOF ;
* declaration     varDecl
*                | statement ;
* varDecl         "var" IDENTIFIER ( "=" expression )? ";" ;
* statement       ifStmt
*                | block
*                | printStmt
*                | whileStmt
*                | forStmt
*                | exprStmt ;
* ifStmt          "if" "(" expression ")" statement
*                ( "else" statement )? ;
* block           "{" declaration* "}" ;
* exprStmt        expression ";" ;
* printStmt       "print" expression ";" ;
* whileStmt       "while" "(" expression ")" statement ;
* forStmt         "for" "(" ( varDecl | exprStmt | ";" ) ")" expression? ";" expression? ")" statement ;
*
* expression      assignment ;
* assignment      IDENTIFIER "=" assignment
*                | logic_or ;
* logic_or        logic_and ( "or" logic_and )* ;
* logic_and       equality ( "and" equality )* ;
* equality        comparison ( ( "!=" | "==" ) comparison )* ;
* comparison      term ( ( ">" | ">=" | "<" | "<=" ) term )* ;
* term            factor ( ( "-" | "+" ) factor )* ;
* factor          unary ( ( "/" | "*" ) unary )* ;
* unary           ( "!" | "-" ) unary
*                | call ;
* call            primary ( "(" arguments? ")" ) *;
* arguments       expression ( "," expression ) *;
* primary         "true" | "false" | "nil"
*                | "(" expression ")" ;
*                | NUMBER | STRING
*                | IDENTIFIER

